import './App.css';
import Row from './Row';
import requests from './requests';


function App() {
  return (
    <div className="App">

     <h1>Netflix-Clone</h1>
     <Row title ="NETFLIX ORIGINALS" fetchUrl={requests.fetchNetflixOrigionals}/>
     <Row title ="Trending Now" fetchUrl={requests.fetchTrending}/>
     <Row title ="Top Rated" />
     <Row title ="Action" />


    </div>
  );
}

export default App;
